css:
.github-PrSelectionByBranch {
  flex: 1;
  display: flex;
  overflow: auto;
}
.github-PrSelectionByBranch-container {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-PrSelectionByBranch-divider {
  margin: 0;
  border-top: 1px solid #e0e0e0;
}
.github-PrSelectionByBranch-cell {
  flex: 1;
  display: flex;
  flex-direction: column;
  justify-content: center;
  text-align: center;
  padding: 20px;
}
.github-PrSelectionByBranch-cell > .github-PrUrlInputBox-Subview {
  flex: none;
}
.github-PrSelectionByBranch-message {
  padding: 0 10px;
  margin: 10px 0;
}
.github-PrSelectionByBranch-input {
  padding: 0 10px;
  margin: 10px 0;
}
.github-PrSelectionByBranch-input .github-PrUrlInputBox-Subview > input {
  margin-top: 0;
}
.github-PrSelectionByBranch-list {
  list-style: none;
  padding-left: 0;
  cursor: default;
}
.github-PrSelectionByBranch-list li {
  padding: 5px 10px;
  border-top: 1px solid #e0e0e0;
}
.github-PrSelectionByBranch-list li:hover {
  background-color: #ebebeb;
}
.github-CreatePr-icon:before {
  font-size: 3em;
}
.github-CreatePr-title {
  font-size: 1.6em;
}
